    return (
        <div className="app-wrapper">
            Hello, samurai! Let's go!
            <header className={'header'}>
                <img src={'https://images.app.goo.gl/u4UWptRj94vnfcC57'}/>
            </header>
            <nav className={'nav'}>
                <div className={'content'}>
                    <div>content</div>
                </div>
            </nav>
            <Header/>
          <Technologies/>
            <Footer/>

        </div>
    );
}


export default App;
